import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import '../styles/RegistrationPage.css';

const RegistrationPage = () => {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    email: '',
    firstName: '',
    lastName: '',
    mobileNumber: '',
    password: '',
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({
      ...prev,
      [name]: value,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // For now, just log form data
    console.log('Form submitted:', formData);
    // Navigate to next page or show success message
  };

  return (
    <div className="registration-page">
      <nav className="navbar">
        <div className="navbar-logo">Visitor Management</div>
        <ul className="navbar-links">
          <li><a href="#home">Home</a></li>
          <li><Link to="/products">Products</Link></li>
          <li><Link to="/resources">Resources</Link></li>
          <li><Link to="/aboutus">About Us</Link></li>
          <li><a href="/bookademo">Book a Demo</a></li>
          <li><a href="/contactus">Contact Us</a></li>
          <li><a href="/register" className="register-btn">Registeration</a></li>
          <li><a href="/login" className="login-btn">Login</a></li>
        </ul>
      </nav>
      <div className="registration-container">
        <form className="registration-form" onSubmit={handleSubmit}>
          <h2>Start using Envoy</h2>
          <p>Create an account to begin a free trial or paid plan</p>

          <label htmlFor="email">
            Email <span className="required">*</span>
          </label>
          <input
            type="email"
            id="email"
            name="email"
            value={formData.email}
            onChange={handleChange}
            required
          />

          <div className="name-fields">
            <div className="name-field">
              <label htmlFor="firstName">
                First name <span className="required">*</span>
              </label>
              <input
                type="text"
                id="firstName"
                name="firstName"
                value={formData.firstName}
                onChange={handleChange}
                required
              />
            </div>
            <div className="name-field">
              <label htmlFor="lastName">
                Last name <span className="required">*</span>
              </label>
              <input
                type="text"
                id="lastName"
                name="lastName"
                value={formData.lastName}
                onChange={handleChange}
                required
              />
            </div>
          </div>

          <label htmlFor="mobileNumber">Mobile number</label>
          <input
            type="tel"
            id="mobileNumber"
            name="mobileNumber"
            value={formData.mobileNumber}
            onChange={handleChange}
          />

          <label htmlFor="password">
            Create password <span className="required">*</span>
          </label>
          <input
            type="password"
            id="password"
            name="password"
            value={formData.password}
            onChange={handleChange}
            required
          />
          <p className="password-hint">
            Password must be at least 8 characters and contain at least one capital letter, one lower case letter, and one number.
          </p>

          <p className="marketing-consent">
            By clicking "Next" you agree to receive marketing communications from Envoy.
          </p>

          <div className="form-footer">
            <button type="submit" className="next-button">
            Next {'>'}
            </button>
          </div>
        </form>

        <div className="info-panel">
          <h3>
            Envoy saves <br />
            administrators <br />
            an average of <br />
            <span className="highlight">100 hours</span> <br />
            per year
          </h3>
          <p className="survey-note">Based on an Envoy customer survey</p>
        </div>
      </div>
    </div>
  );
};

export default RegistrationPage;
